css:
.highlight.linter-warning .region {
  background: linear-gradient(to bottom, #cb4b16 0%, rgba(203, 75, 22, 0.30000000000000004) 20%, rgba(203, 75, 22, 0.30000000000000004) 80%, #cb4b16 100%);
  border-left: 2px solid #cb4b16;
  border-right: 2px solid #cb4b16;
}
.highlight.linter-error .region {
  background: linear-gradient(to bottom, #dc322f 0%, rgba(220, 50, 47, 0.30000000000000004) 20%, rgba(220, 50, 47, 0.30000000000000004) 80%, #dc322f 100%);
  border-left: 2px solid #dc322f;
  border-right: 2px solid #dc322f;
}
